import storeItems from "../data/items.json"
import{ Col, Row } from "react-bootstrap"

export function Pencils(){
    return(
    <>
    <Row>
        {storeItems.map(item => (
            <Col>{JSON.stringify(item)}</Col>
        ))}
    </Row>
    </>
        )
}

export default Pencils
